olate z-0 border-retro-sectionBorder sm:pr-[13px] ycdcPlus:pr-0 pt-6 lg:pt-9 pb-6 lg:pb-9"><h3 class="text-xl font-semibold uppercase tracking-wider text-yellow-600">Recent Posts </h3><div class="mx-auto mt-12 grid max-w-lg gap-9 lg:max-w-none lg:grid-cols-3"><div class="flex flex-col overflow-hidden rounded shadow"><div class="shrink-0"><a href="/blog/meet-the-yc-winter-2023-batch"><img width="300" class="h-48 w-full object-cover" src="/blog/content/images/2023/04/BlogTwitter-Image-Template--2-1024_1.png" alt=""></a></div><div class="flex flex-1 flex-col justify-between bg-white p-6"><div class="flex-1"><a href="/blog/meet-the-yc-winter-2023-batch" class="mt-2 block"><p class="text-xl font-semibold text-gray-900">Meet the YC Winter 2023 Batch</p><p class="mt-3 text-base text-gray-700">Today, we're kicking off our 36th Demo Day — featuring founders from over 250 startups, building across a variety of verticals including B2B/enterprise, fintech, healthcare, consumer, climate, and more.</p></a></div><div class="mt-2"><p class="text-sm font-medium text-indigo-600"><a href="/blog/tag/yc-news"><span class="mr-4 mb-2 inline-flex items-center rounded bg-gray-200 px-2 py-0.5 text-xs font-medium text-gray-800">YC News</span></a><a href="/blog/tag/batch-stats"><span class="mr-4 mb-2 inline-flex items-center rounded bg-gray-200 px-2 py-0.5 text-xs font-medium text-gray-800">Batch Stats</span></a></p></div><div class="mt-6 flex items-center"><div class="shrink-0"><a href="/blog/author/michael-seibel"><span class="sr-only">Michael Seibel</span><img width="40" class="h-10 w-10 rounded-full" src="/blog/content/images/2022/02/Michael.jpg" alt=""></a></div><div class="ml-4"><p class="text-sm font-medium text-gray-800"><a href="/blog/author/michael-seibel" class="hover:underline">Michael Seibel</a></p><div class="flex space-x-1 text-sm text-gray-500"><span>2023/4/5</span></div></div></div></div></div><div class="flex flex-col overflow-hidden rounded shadow"><div class="shrink-0"><a href="/blog/building-apis-for-ai-an-interview-with-zapiers-bryan-helmig"><img width="300" class="h-48 w-full object-cover" src="/blog/content/images/2023/03/og-NLA_tm3lap.png" alt=""></a></div><div class="flex flex-1 flex-col justify-between bg-white p-6"><div class="flex-1"><a href="/blog/building-apis-for-ai-an-interview-with-zapiers-bryan-helmig" class="mt-2 block"><p class="text-xl font-semibold text-gray-900">Building APIs for AI: An Interview with Zapier’s Bryan Helmig</p><p class="mt-3 text-base text-gray-700">We sat down with Bryan Helmig, the CTO and founder of Zapier, to talk APIs and interoperability, and learn more about the company’s first-ever public API: Natural Language Actions (NLA).</p></a></div><div class="mt-2"><p class="text-sm font-medium text-indigo-600"><a href="/blog/tag/technical"><span class="mr-4 mb-2 inline-flex items-center rounded bg-gray-200 px-2 py-0.5 text-xs font-medium text-gray-800">Technical</span></a><a href="/blog/tag/interview"><span class="mr-4 mb-2 inline-flex items-center rounded bg-gray-200 px-2 py-0.5 text-xs font-medium text-gray-800">Interview</span></a></p></div><div class="mt-6 flex items-center"><div class="shrink-0"><a href="/blog/author/garry"><span class="sr-only">Garry Tan</span><img width="40" class="h-10 w-10 rounded-full" src="/blog/content/images/2023/03/Instagram-Image-Template--Square---21-.png" alt=""></a></div><div class="ml-4"><p class="text-sm font-medium text-gray-800"><a href="/blog/author/garry" class="hover:underline">Garry Tan</a></p><div class="flex space-x-1 text-sm text-gray-500"><span>2023/3/22</span></div></div></div></div></div><div class="flex flex-col overflow-hidden rounded shadow"><div class="shrink-0"><a href="/blog/yc-meetup-on-building-open-source-software-startups"><img width="300" class="h-48 w-full object-cover" src="/blog/content/images/2023/03/asdfads.png" alt=""></a></div><div class="flex flex-1 flex-col justify-between bg-white p-6"><div class="flex-1"><a href="/blog/yc-meetup-on-building-open-source-software-startups" class="mt-2 block"><p class="text-xl font-semibold text-gray-900">YC Meetup on Building Open Source Software Startups</p><p class="mt-3 text-base text-gray-700">We're hosting a meetup for Open Source Software startups! YC has funded over 75 OSS companies to date and we’re especially excited about them. If you’re interested in starting one someday, join us to connect &amp; learn with other founders in the space.</p></a></div><div class="mt-2"><p class="text-sm font-medium text-indigo-600"><a href="/blog/tag/yc-news"><span class="mr-4 mb-2 inline-flex items-center rounded bg-gray-200 px-2 py-0.5 text-xs font-medium text-gray-800">YC News</span></a><a href="/blog/tag/yc-events"><span class="mr-4 mb-2 inline-flex items-center rounded bg-gray-200 px-2 py-0.5 text-xs font-medium text-gray-800">YC Events</span></a></p></div><div class="mt-6 flex items-center"><div class="shrink-0"><a href="/blog/author/yc"><span class="sr-only">Y Combinator</span><img width="40" class="h-10 w-10 rounded-full" src="/blog/content/images/2022/02/yc.png" alt=""></a></div><div class="ml-4"><p class="text-sm font-medium text-gray-800"><a href="/blog/author/yc" class="hover:underline">Y Combinator</a></p><div class="flex space-x-1 text-sm text-gray-500"><span>2023/3/17</span></div></div></div></div></div></div></section><section class="relative isolate z-0 border-retro-sectionBorder sm:pr-[13px] ycdcPlus:pr-0 pt-6 lg:pt-9 pb-6 lg:pb-9"><div class="mt-2 grid max-w-lg gap-5 lg:max-w-none lg:grid-cols-3"><div class="col-span-2"><h3 class="text-xl font-semibold uppercase tracking-wider text-yellow-600">All Posts</h3><div class="flex flex-col overflow-hidden rounded-lg"><div class="mb-6 mr-6 flex flex-1 flex-col justify-between"><div class="flex-1"><a href="/blog/changes-at-yc" class="mt-2 block"><p class="text-3xl font-semibold text-gray-900">Changes at YC</p></a><p class="text-md py-2 text-gray-500">by <a href="/blog/author/garry" class="text-blue-500 hover:underline"><span class="">Garry Tan</span></a><span class="ml-4 text-sm font-normal">2023/3/14</span></p><p class="mt-3 text-base text-gray-800">In recent years, we have also done some late stage investing. But late stage investing turned out to be so different from early stage that we found it to be a distraction from our core mission. So we’re going to decrease the amount of late stage investing we do.</p><div class="mt-4"><a class="inline-flex text-sm font-medium text-blue-500 md:text-base" href="/blog/changes-at-yc">Read More<!-- --> <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" aria-hidden="true" class="mx-1 h-6 w-6" width="1.25em" height="1.25em"><path stroke-linecap="round" stroke-linejoin="round" d="M13 9l3 3m0 0l-3 3m3-3H8m13 0a9 9 0 11-18 0 9 9 0 0118 0z"></path></svg></a></div></div></div></div><div class="flex flex-col overflow-hidden rounded-lg"><div class="mb-6 mr-6 flex flex-1 flex-col justify-between"><div class="flex-1"><a href="/blog/urgent-sign-the-petition-now-thousands-of-startups-and-hundreds-of-thousands-of-startup-jobs-are-at-risk" class="mt-2 block"><p class="text-3xl font-semibold text-gray-900">Urgent: Sign the petition now</p></a><p class="text-md py-2 text-gray-500">by <a href="/blog/author/yc" class="text-blue-500 hover:underline"><span class="">Y Combinator</span></a><span class="ml-4 text-sm font-normal">2023/3/12</span></p><p class="mt-3 text-base text-gray-800">Nearly 40,000 of all depositors at Silicon Valley Bank were small businesses. If swift action isn’t taken, over 100,000 people could soon lose their jobs.</p><div class="mt-4"><a class="inline-flex text-sm font-medium text-blue-500 md:text-base" href="/blog/urgent-sign-the-petition-now-thousands-of-startups-and-hundreds-of-thousands-of-startup-jobs-are-at-risk">Read More<!-- --> <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" aria-hidden="true" class="mx-1 h-6 w-6" width="1.25em" height="1.25em"><path stroke-linecap="round" stroke-linejoin="round" d="M13 9l3 3m0 0l-3 3m3-3H8m13 0a9 9 0 11-18 0 9 9 0 0118 0z"></path></svg></a></div></div></div></div><div class="flex flex-col overflow-hidden rounded-lg"><div class="mb-6 mr-6 flex flex-1 flex-col justify-between"><div class="flex-1"><a href="/blog/surbhi-sarnas-new-book-on-entrepreneurship" class="mt-2 block"><p class="text-3xl font-semibold text-gray-900">Surbhi Sarna's new book on entrepreneurship</p></a><p class="text-md py-2 text-gray-500">by <a href="/blog/author/jared-friedman" class="text-blue-500 hover:underline"><span class="">Jared Friedman</span></a><span class="ml-4 text-sm font-normal">2023/3/8</span></p><p class="mt-3 text-base text-gray-800">YC Group Partner Surbhi Sarna has written a book called Without a Doubt, and today it goes on sale.Without a Doubt tells the incredible story of Surbhi Sarna's company, nVisionMedical, which started with a health scare when she was 13 and ended 20 yearslater in a $275M acquisition. It's a must-read for anyone interested inhealthcare.</p><div class="mt-4"><a class="inline-flex text-sm font-medium text-blue-500 md:text-base" href="/blog/surbhi-sarnas-new-book-on-entrepreneurship">Read More<!-- --> <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" aria-hidden="true" class="mx-1 h-6 w-6" width="1.25em" height="1.25em"><path stroke-linecap="round" stroke-linejoin="round" d="M13 9l3 3m0 0l-3 3m3-3H8m13 0a9 9 0 11-18 0 9 9 0 0118 0z"></path></svg></a></div></div></div></div><div class="flex flex-col overflow-hidden rounded-lg"><div class="mb-6 mr-6 flex flex-1 flex-col justify-between"><div class="flex-1"><a href="/blog/yc-spring-2022-tech-hiring-event" class="mt-2 block"><p class="text-3xl font-semibold text-gray-900">Announcing Y Combinator's Spring 2022 Tech Hiring Event</p></a><p class="text-md py-2 text-gray-500">by <a href="/blog/author/rchoi" class="text-blue-500 hover:underline"><span class="">Ryan Choi</span></a><span class="ml-4 text-sm font-normal">2023/3/1</span></p><p class="mt-3 text-base text-gray-800">We're excited to host an in-person tech hiring event on Wednesday, March 8th at 5:30 PM at YCombinator's San Francisco office. This will be the first in-person hiring eventwe're hosting at YC in over two years, and we have 9 YC-backed startups who arelooking to hire engineers and technical talent.The event will feature brief founder &amp; company overviews, time to network, andlight food and drinks provided by YC.</p><div class="mt-4"><a class="inline-flex text-sm font-medium text-blue-500 md:text-base" href="/blog/yc-spring-2022-tech-hiring-event">Read More<!-- --> <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" aria-hidden="true" class="mx-1 h-6 w-6" width="1.25em" height="1.25em"><path stroke-linecap="round" stroke-linejoin="round" d="M13 9l3 3m0 0l-3 3m3-3H8m13 0a9 9 0 11-18 0 9 9 0 0118 0z"></path></svg></a></div></div></div></div><div class="flex flex-col overflow-hidden rounded-lg"><div class="mb-6 mr-6 flex flex-1 flex-col justify-between"><div class="flex-1"><a href="/blog/yc-top-companies-feb-2023" class="mt-2 block"><p class="text-3xl font-semibold text-gray-900">Congratulations to the 2023 YC Top Companies!</p></a><p class="text-md py-2 text-gray-500">by <a href="/blog/author/yc" class="text-blue-500 hover:underline"><span class="">Y Combinator</span></a><span class="ml-4 text-sm font-normal">2023/2/28</span></p><p class="mt-3 text-base text-gray-800">There are now 16 public YC companies, 290 private YC companies and 33 exits that are valued at over $150M, and over 80 that are worth more than $1B.</p><div class="mt-4"><a class="inline-flex text-sm font-medium text-blue-500 md:text-base" href="/blog/yc-top-companies-feb-2023">Read More<!-- --> <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" aria-hidden="true" class="mx-1 h-6 w-6" width="1.25em" height="1.25em"><path stroke-linecap="round" stroke-linejoin="round" d="M13 9l3 3m0 0l-3 3m3-3H8m13 0a9 9 0 11-18 0 9 9 0 0118 0z"></path></svg></a></div></div></div></div><div class="flex flex-col overflow-hidden rounded-lg"><div class="mb-6 mr-6 flex flex-1 flex-col justify-between"><div class="flex-1"><a href="/blog/why-would-you-work-at-a-startup-in-an-economic-downturn" class="mt-2 block"><p class="text-3xl font-semibold text-gray-900">Why would you work at a startup in an economic downturn?</p></a><p class="text-md py-2 text-gray-500">by <a href="/blog/author/rchoi" class="text-blue-500 hover:underline"><span class="">Ryan Choi</span></a><span class="ml-4 text-sm font-normal">2023/2/24</span></p><p class="mt-3 text-base text-gray-800">Now is as good a time as any to start a startup – especially if you get into YC. But what about joining a startup in this economy? We’re obviously biased, but we think it’s a great time to join a startup too. Here are three reasons to consider.</p><div class="mt-4"><a class="inline-flex text-sm font-medium text-blue-500 md:text-base" href="/blog/why-would-you-work-at-a-startup-in-an-economic-downturn">Read More<!-- --> <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" aria-hidden="true" class="mx-1 h-6 w-6" width="1.25em" height="1.25em"><path stroke-linecap="round" stroke-linejoin="round" d="M13 9l3 3m0 0l-3 3m3-3H8m13 0a9 9 0 11-18 0 9 9 0 0118 0z"></path></svg></a></div></div></div></div><nav class="flex items-center justify-between border-t border-gray-200 py-3" aria-label="Pagination"><div class="hidden sm:block"><p class="text-sm text-gray-700">Showing<!-- --> <span class="font-medium">1</span> <!-- -->to<!-- --> <span class="font-medium">10</span> <!-- -->of <span class="font-medium">2669</span> total posts</p></div><div class="flex flex-1 justify-between sm:justify-end"><a class="relative 