="0 0 24 24" width="1.25em" height="1.25em" class="h-6 w-6" aria-hidden="true"><title>YouTube</title><path d="M23.498 6.186a3.016 3.016 0 0 0-2.122-2.136C19.505 3.545 12 3.545 12 3.545s-7.505 0-9.377.505A3.017 3.017 0 0 0 .502 6.186C0 8.07 0 12 0 12s0 3.93.502 5.814a3.016 3.016 0 0 0 2.122 2.136c1.871.505 9.376.505 9.376.505s7.505 0 9.377-.505a3.015 3.015 0 0 0 2.122-2.136C24 15.93 24 12 24 12s0-3.93-.502-5.814zM9.545 15.568V8.432L15.818 12l-6.273 3.568z"></path></svg></a></div><p class="mt-8 text-base md:order-1 md:mt-0">© 2023 Y Combinator.</p></div></div></footer></div>
      <script type="application/json" class="js-react-on-rails-component" data-component-name="BlogList" data-dom-id="BlogList-react-component-3629a70f-3370-4345-a235-a7200ade0ad4">{"posts":[{"id":"642348dc50615b000151d876","uuid":"b0ef1c22-4a48-45b2-b397-2fc9a3e4f397","title":"Meet the YC Winter 2023 Batch","slug":"meet-the-yc-winter-2023-batch","html":"\u003cp\u003eFor the Winter 2023 batch, we received over 20,000 applications from founders around the world and funded \u003ca href=\"https://www.ycombinator.com/companies?batch=W23\"\u003e282\u003c/a\u003e. Smart founders \u003ca href=\"https://www.ycombinator.com/blog/why-would-you-start-a-startup-in-an-economic-downturn\"\u003eknow\u003c/a\u003e now is a great time to start a startup. \u003c/p\u003e\u003cp\u003eToday, these founders will present their companies to an invite-only audience of investors at our 36th \u003ca href=\"https://www.ycombinator.com/demoday/faq/\"\u003eDemo Day\u003c/a\u003e. Here’s what we saw in the W23 batch:\u003c/p\u003e\u003cul\u003e\u003cli\u003e59% of the batch applied more than once\u003c/li\u003e\u003cli\u003e52% of the batch were accepted with only an idea\u003c/li\u003e\u003cli\u003e28% of the batch raised money before YC\u003c/li\u003e\u003cli\u003e77% of the batch had zero revenue before YC\u003c/li\u003e\u003cli\u003e2% had more than $50k of monthly revenue when accepted\u003c/li\u003e\u003c/ul\u003e\u003cp\u003e86% of W23 founders lived in the Bay Area. The batch kicked off with an in-person retreat, followed by weekly meetups in San Francisco. Though most founders spent the batch in the Bay Area, the program was still remote friendly, with batch talks and office hours hosted online.\u003c/p\u003e\u003cfigure class=\"kg-card kg-image-card\"\u003e\u003cimg src=\"https://ghost.prod.ycinside.com/content/images/2023/03/XL5HyasU.jpeg\" class=\"kg-image\" alt loading=\"lazy\" width=\"2000\" height=\"1333\" srcset=\"https://ghost.prod.ycinside.com/content/images/size/w600/2023/03/XL5HyasU.jpeg 600w, https://ghost.prod.ycinside.com/content/images/size/w1000/2023/03/XL5HyasU.jpeg 1000w, https://ghost.prod.ycinside.com/content/images/size/w1600/2023/03/XL5HyasU.jpeg 1600w, https://ghost.prod.ycinside.com/content/images/2023/03/XL5HyasU.jpeg 2048w\" sizes=\"(min-width: 720px) 720px\"\u003e\u003c/figure\u003e\u003cp\u003eYC Winter 2023's 282 companies were divided into sections of 7-10 companies, which were led by 19 group partners and visiting group partners and organized by vertical. \u003c/p\u003e\u003cp\u003eThe most common themes of this batch were open source, dev tools, and AI, and company verticals broke down as follows:\u003c/p\u003e\u003cul\u003e\u003cli\u003e54% in B2B/Enterprise SaaS\u003c/li\u003e\u003cli\u003e17% in DevTools\u003c/li\u003e\u003cli\u003e12% in Fintech\u003c/li\u003e\u003cli\u003e7% in Healthcare\u003c/li\u003e\u003cli\u003e5% in Consumer\u003c/li\u003e\u003cli\u003e3% in Proptech\u003c/li\u003e\u003cli\u003e2% in Climate, Energy, or Sustainability\u003c/li\u003e\u003cli\u003e1% in Aerospace\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eHere is the demographic breakdown* for the W23 batch:\u003c/p\u003e\u003cul\u003e\u003cli\u003e13% Asian\u003c/li\u003e\u003cli\u003e2% Black\u003c/li\u003e\u003cli\u003e5% Hispanic or Latino\u003c/li\u003e\u003cli\u003e3% Middle Eastern or North African\u003c/li\u003e\u003cli\u003e8% Multiracial\u003c/li\u003e\u003cli\u003e15% South Asian\u003c/li\u003e\u003cli\u003e29% White\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eAdditionally, 17% of the companies have a woman founder and 8% of the founders are women.\u003c/p\u003e\u003cfigure class=\"kg-card kg-image-card\"\u003e\u003cimg src=\"https://ghost.prod.ycinside.com/content/images/2023/03/gaI7d_Lw.jpeg\" class=\"kg-image\" alt loading=\"lazy\" width=\"2000\" height=\"1331\" srcset=\"https://ghost.prod.ycinside.com/content/images/size/w600/2023/03/gaI7d_Lw.jpeg 600w, https://ghost.prod.ycinside.com/content/images/size/w1000/2023/03/gaI7d_Lw.jpeg 1000w, https://ghost.prod.ycinside.com/content/images/size/w1600/2023/03/gaI7d_Lw.jpeg 1600w, https://ghost.prod.ycinside.com/content/images/size/w2400/2023/03/gaI7d_Lw.jpeg 2400w\" sizes=\"(min-width: 720px) 720px\"\u003e\u003c/figure\u003e","comment_id":"642348dc50615b000151d876","feature_image":"/blog/content/images/2023/04/BlogTwitter-Image-Template--2-1024_1.png","featured":true,"visibility":"public","email_recipient_filter":"none","created_at":"2023-03-28T13:06:52.000-07:00","updated_at":"2023-04-05T08:30:00.000-07:00","published_at":"2023-04-05T08:30:00.000-07:00","custom_excerpt":"Today, we're kicking off our 36th Demo Day — featuring founders from over 250 startups, building across a variety of verticals including B2B/enterprise, fintech, healthcare, consumer, climate, and more.","codeinjection_head":null,"codeinjection_foot":null,"custom_template":null,"canonical_url":null,"authors":[{"id":"61fe29e3c7139e0001a710b0","name":"Michael Seibel","slug":"michael-seibel","profile_image":"/blog/content/images/2022/02/Michael.jpg","cover_image":null,"bio":"Michael Seibel is a Group Partner and Managing Director, Early Stage at YC. He was the cofounder and CEO Justin.tv and Socialcam. Socialcam sold to Autodesk in 2012 and Justin.tv became Twitch.","website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/michael-seibel/"}],"tags":[{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/yc-news/"},{"id":"61fe29efc7139e0001a7117a","name":"Batch Stats","slug":"batch-stats","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/batch-stats/"}],"primary_author":{"id":"61fe29e3c7139e0001a710b0","name":"Michael Seibel","slug":"michael-seibel","profile_image":"https://ghost.prod.ycinside.com/content/images/2022/02/Michael.jpg","cover_image":null,"bio":"Michael Seibel is a Group Partner and Managing Director, Early Stage at YC. He was the cofounder and CEO Justin.tv and Socialcam. Socialcam sold to Autodesk in 2012 and Justin.tv became Twitch.","website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/michael-seibel/"},"primary_tag":{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/yc-news/"},"url":"https://ghost.prod.ycinside.com/meet-the-yc-winter-2023-batch/","excerpt":"Today, we're kicking off our 36th Demo Day — featuring founders from over 250 startups, building across a variety of verticals including B2B/enterprise, fintech, healthcare, consumer, climate, and more.","reading_time":2,"access":true,"og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"email_subject":null,"frontmatter":null,"feature_image_alt":null,"feature_image_caption":null},{"id":"641a393150615b000151d84b","uuid":"c024d53d-8c70-4b05-9d7a-879111b8b495","title":"Building APIs for AI: An Interview with Zapier’s Bryan Helmig","slug":"building-apis-for-ai-an-interview-with-zapiers-bryan-helmig","html":"\u003cp\u003eNearly ten years ago I wrote about the \u003ca href=\"https://blog.garrytan.com/the-api-ization-of-everything\"\u003eAPI-ization of everything\u003c/a\u003e. It seemed obvious then that software that talks to other software would be critical for building world-changing startups. What was less obvious then and more obvious now, is that those APIs would need to be connected to harness the full potential of everyday apps.\u003c/p\u003e\u003cp\u003eOne of the best companies at connecting APIs is Zapier, which went through the YC Summer 2012 batch. Zapier, the leader in easy automation, makes it simple to automate workflows and move data across 5000+ apps. Setup takes less than six minutes and there’s not a single line of code. And with over 5,000 of the most popular B2B and consumer apps integrated, they’re already powering over 10 million integration possibilities.\u003c/p\u003e\u003cp\u003eI got a chance to sit down with Bryan Helmig (@\u003ca href=\"https://twitter.com/bryanhelmig?lang=en\"\u003ebryanhelmig\u003c/a\u003e), the CTO and founder of Zapier, to talk APIs, interoperability, and learn more about the company’s first-ever public API: Natural Language Actions (NLA). With this new API, they’re making it possible to plug integrations directly into your product, and it's optimized for LLMs.  \u003c/p\u003e\u003chr\u003e\u003cp\u003e\u003cstrong\u003eBryan, thanks for joining me and finding time to catch up. Given the launch of your new Natural Language (NLA) API, I’m sure there was some insight or trend you were seeing that guided your build. \u003c/strong\u003e\u003c/p\u003e\u003cp\u003eBryan: Absolutely. AI apps have become the fastest-growing category of apps on Zapier’s platform… ever. We're seeing a huge demand from our users and partner ecosystem, to plug AI and large language models into their existing tools, workflows and automation. And Zapier is well positioned to help – 81 billion workflow tasks have already been created on our platform. \u003c/p\u003e\u003cp\u003eWe actually started by prototyping LLM products into our own tech stack. We had two previous product experiments before NLA. The first was a fully chat-based Zap setup flow. With current-generation models, this often felt like playing \"20 questions\" with the model – not a great user experience. But it made us realize that other developers were likely facing the same challenges, and that Zapier could really deliver a seamless and simple developer experience in a way that no other company could. \u003c/p\u003e\u003cp\u003eFrom there, we focused on how to wrap up and simplify each individual API endpoint you might find across Zapier's 20k+ actions. We then allowed the model to call each one as a separate “tool”. That was the fundamental design principle we used internally, and it helped us to expose this as the new NLA API – for any developer to add integrations into that products or internal tools in 5-10 minutes. \u003c/p\u003e\u003cp\u003e\u003cstrong\u003eFor a team that’s the expert in APIs, launching Zapier’s first public API is a big deal. What about LLMs made this project different from how you’ve previously approached APIs in the past?\u003c/strong\u003e\u003c/p\u003e\u003cp\u003ePrior to LLMs, we never felt like we could deliver the magical developer experience that we wanted to. Under the hood, Zapier wraps up a ton of complexity from our ecosystem – our platform handles around 20 types of API auths, custom fields, versioning and migrations, arbitrary payload sizes, binary data. You name it. Making a Zapier API would have meant passing along all that complexity to our end users. \u003c/p\u003e\u003cp\u003eBut now, AI and LLMs bring an interesting inflection point for Zapier: The new Natural Language Actions API abstracts all that complexity away from devs. In fact, the API has only one required parameter: \"instructions\". NLA can also be used in the more \"classic\" way by calling it hard-coded parameters instead of natural language parsing, but the natural language capabilities make it especially useful for people building products\u003cem\u003e on top\u003c/em\u003e of LLMs. Ultimately we are using LLMs to make APIs easier to use for both humans and other LLMs!\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eAnd what are some of the exciting things you’re seeing people build with your APIs?\u003c/strong\u003e\u003c/p\u003e\u003cp\u003e\u003ca href=\"https://zapier.com/blog/how-a-contractor-uses-ai-to-write-business-emails/\"\u003eThere's this amazing story\u003c/a\u003e about a contractor with dyslexia who teamed up with a client of his who happened to be familiar with Zapier. They built a Zap with OpenAI’s GPT-3 to write better business emails. It totally transformed his communication and even helped him land a massive $200,000 contract! It’s those stories of AI and automation coming together to help individual people that makes me excited to be building on this technology today.\u003c/p\u003e\u003cp\u003eBut, really, we’re just scratching the surface. We can’t predict what all the builders on our Zapier platform will create. I mean, when we launched multi-step Zaps 5 years ago, we set a \"sanity\" limit of 30 [workflow] steps. We thought that would clearly be enough for anybody. But in less than 24 hours, users were inundating us to raise the limit. And as we dug in deeper, and found these beautiful, mind-blowing and complex Zaps – things we couldn’t have ever imagined. With LLMs in the mix, we’re hoping we’ll enable that same level of creativity and power, and now from the developer community. \u003c/p\u003e\u003cp\u003e\u003cstrong\u003eSo with all of the power that LLMs bring to the table, can you share what’s actually happening under the hood? How have you kept it simple? \u003c/strong\u003e\u003c/p\u003e\u003cp\u003eAt its core, we leverage OpenAI’s GPT3.5 series to understand and process natural language instructions from the user, map it to a specific API call, and return the response from the API – all in a way that’s optimized for LLMs.\u003c/p\u003e\u003cp\u003eFirst, users give explicit permission to the model to access certain actions. We try to make this super fast and simple, to feel like an OAuth flow to the end user. When a user is setting this up, they’re able to see what the required fields are and either let the AI guess or manually specify the values. Then once in a developer’s platform, the only required field for the user is the natural language instruction. We take that instruction from a user and let the model figure out how to fill in the required fields. The model then constructs an API call. \u003c/p\u003e\u003cp\u003eBefore we can send the results back, we also need to make it LLM and human-readable. Many APIs return really complex data in their API responses that would not only cause an LLM to go over its token limit but it confuses both the model and the user. (As an example, a Gmail API call returns over 10,000 tokens!). We've done work on our end to trim down the results to expose just the relevant pieces. The NLA API currently guarantees arbitrary API payloads will fit into 350 tokens or fewer. This makes it incredibly easy to use and build on the NLA API without worrying about the data input or output with the APIs.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eAnd for any aspiring API developer reading this – either looking to use your new APIs or even building their own – any tips from the guys who live and breathe APIs all day?\u003c/strong\u003e\u003c/p\u003e\u003cp\u003eDefinitely. The big thing many APIs \"get wrong\" is being overly complex, overly unique, and overly hard to get started. You’ve talked about how Stripe and Lob have gotten payments and shipping right by simplifying complexity; we leaned on similar examples for inspiration. If you’re building an API, you should too.\u003c/p\u003e\u003cp\u003eWe're definitely big fans of libraries like \u003ca href=\"https://django-ninja.rest-framework.com/\"\u003edjango-ninja\u003c/a\u003e or \u003ca href=\"https://fastapi.tiangolo.com/\"\u003eFastAPI\u003c/a\u003e for creating compelling APIs with baked-in types and documentation. We're using that sort of technology under the hood as well, both for design consistency and for scalability. \u003c/p\u003e\u003cp\u003eIn the development of our NLA, we've tried to be strict about not letting internal complexity filter down to end developers. NLA supports both OAuth and API keys for quickly getting started, and we have several off-the-shelf examples in the \u003ca href=\"https://nla.zapier.com/api/v1/dynamic/docs\"\u003eAPI documentation\u003c/a\u003e, including a published \u003ca href=\"https://blog.langchain.dev/langchain-zapier-nla/\"\u003eLangChain integration\u003c/a\u003e.\u003c/p\u003e\u003cp\u003eIf you want to get started, any developer can \u003ca href=\"https://nla.zapier.com/get-started/\"\u003ecreate an API key right away\u003c/a\u003e. We’re excited to see what you can imagine, and please share – tag me on Twitter (\u003ca href=\"https://twitter.com/bryanhelmig?lang=en\"\u003e@bryanhelmig\u003c/a\u003e) and show me what you’ve got. And even better, I’d love feedback on what we’ve built, and we’re here to answer questions. And if you’re an API geek like the rest of us at Zapier… \u003ca href=\"https://zapier.com/jobs\"\u003ewe’re hiring\u003c/a\u003e.\u003c/p\u003e","comment_id":"641a393150615b000151d84b","feature_image":"/blog/content/images/2023/03/og-NLA_tm3lap.png","featured":false,"visibility":"public","email_recipient_filter":"none","created_at":"2023-03-21T16:09:37.000-07:00","updated_at":"2023-03-22T08:59:00.000-07:00","published_at":"2023-03-22T08:59:00.000-07:00","custom_excerpt":"We sat down with Bryan Helmig, the CTO and founder of Zapier, to talk APIs and interoperability, and learn more about the company’s first-ever public API: Natural Language Actions (NLA).","codeinjection_head":null,"codeinjection_foot":null,"custom_template":null,"canonical_url":null,"authors":[{"id":"61fe29e3c7139e0001a710d2","name":"Garry Tan","slug":"garry","profile_image":"/blog/content/images/2023/03/Instagram-Image-Template--Square---21-.png","cover_image":null,"bio":"Garry is the President \u0026 CEO of Y Combinator. Previously, he was the co-founder \u0026 Managing Partner of Initialized Capital. Before that, he co-founded Posterous (YC S08) which was acquired by Twitter.","website":null,"location":null,"facebook":null,"twitter":"@garrytan","meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/garry/"}],"tags":[{"id":"62b9edfe063d2d0001f0fc58","name":"#442","slug":"hash-442","description":null,"feature_image":null,"visibility":"internal","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/404/"},{"id":"61fe29efc7139e0001a71196","name":"Technical","slug":"technical","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/technical/"},{"id":"61fe29efc7139e0001a71175","name":"Interview","slug":"interview","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/interview/"}],"primary_author":{"id":"61fe29e3c7139e0001a710d2","name":"Garry Tan","slug":"garry","profile_image":"https://ghost.prod.ycinside.com/content/images/2023/03/Instagram-Image-Template--Square---21-.png","cover_image":null,"bio":"Garry is the President \u0026 CEO of Y Combinator. Previously, he was the co-founder \u0026 Managing Partner of Initialized Capital. Before that, he co-founded Posterous (YC S08) which was acquired by Twitter.","website":null,"location":null,"facebook":null,"twitter":"@garrytan","meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/garry/"},"primary_tag":null,"url":"https://ghost.prod.ycinside.com/building-apis-for-ai-an-interview-with-zapiers-bryan-helmig/","excerpt":"We sat down with Bryan Helmig, the CTO and founder of Zapier, to talk APIs and interoperability, and learn more about the company’s first-ever public API: Natural Language Actions (NLA).","reading_time":5,"access":true,"og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"email_subject":null,"frontmatter":null,"feature_image_alt":null,"feature_image_caption":null},{"id":"6413474fc1abdc000107c9f8","uuid":"05f7267f-823b-4485-9995-dafe9d6031ef","title":"YC Meetup on Building Open Source Software Startups","slug":"yc-meetup-on-building-open-source-software-startups","html":"\u003cp\u003eWe're hosting a small reception at our office in San Francisco, on \u003cstrong\u003e\u003ca href=\"https://apply.ycombinator.com/events/346\"\u003eApril 11th at 5pm PT\u003c/a\u003e\u003c/strong\u003e, for people who are interested in the growing trend of Open Source Software startups. We've funded over 75 OSS companies to date and we’re especially excited about them.\u003c/p\u003e\u003cp\u003eIf you’re interested in maybe starting an open source company someday, this is a good opportunity to get to know some of the top founders in this area and hear the latest best practices.\u003c/p\u003e\u003cp\u003eWe’ll host a panel with:\u003cbr\u003e• \u003ca href=\"https://www.linkedin.com/in/solomonhykes/\"\u003e\u003cstrong\u003eSolomon Hykes\u003c/strong\u003e\u003c/a\u003e, co-founder of \u003ca href=\"https://www.ycombinator.com/companies/docker\"\u003eDocker\u003c/a\u003e and \u003ca href=\"https://www.ycombinator.com/companies/dagger\"\u003eDagger\u003c/a\u003e\u003cbr\u003e• \u003ca href=\"https://www.linkedin.com/in/debergalis/\"\u003e\u003cstrong\u003eMatt DeBergalis\u003c/strong\u003e\u003c/a\u003e, co-founder of \u003ca href=\"https://www.ycombinator.com/companies/apollo\"\u003eApollo GraphQL\u003c/a\u003e (valued over $1B)\u003cbr\u003e• \u003ca href=\"https://www.linkedin.com/in/umurc/\"\u003e\u003cstrong\u003eUmur Cubukcu\u003c/strong\u003e\u003c/a\u003e, co-founder of \u003ca href=\"https://www.ycombinator.com/companies/citus-data\"\u003eCitus Data\u003c/a\u003e (acquired by Microsoft) and now Visiting Group Partner at Y Combinator\u003cbr\u003e• \u003ca href=\"https://www.linkedin.com/in/reshmakhilnani/\"\u003e\u003cstrong\u003eReshma Khilnani\u003c/strong\u003e\u003c/a\u003e, co-founder of \u003ca href=\"https://www.ycombinator.com/companies/medplum\"\u003eMedPlum\u003c/a\u003e and former Visiting Group Partner at Y Combinator\u003c/p\u003e\u003cp\u003eand also a short talk from Daniel Gackle who runs \u003ca href=\"https://news.ycombinator.com/\"\u003eHacker News\u003c/a\u003e.\u003c/p\u003e\u003cp\u003eAfter the panel, we’ll have a cocktail reception. We’ve invited many other founders of YC Open Source Software companies so you can get to know them 1-1. YC Group Partners will be around if you want to bounce around ideas about possible startups.\u003c/p\u003e\u003cp\u003eWe have limited space and expect the event to be over-subscribed. Please complete the form below, and we’ll reach out if we can offer you a spot at the event.\u003c/p\u003e\u003c!--kg-card-begin: html--\u003e\u003ccenter\u003e\n\u003ca class=\"ycdc-retro-btn ycdc-retro-btn-gold mt-[-10px] ml-[13px]\" href=\"https://apply.ycombinator.com/events/346\" style=\"text-decoration: none;\" title=\"title for your link\" target=\"_blank\"\u003eApply to attend\u003c/a\u003e\n\u003c/center\u003e\u003c!--kg-card-end: html--\u003e","comment_id":"6413474fc1abdc000107c9f8","feature_image":"/blog/content/images/2023/03/asdfads.png","featured":true,"visibility":"public","email_recipient_filter":"none","created_at":"2023-03-16T09:43:59.000-07:00","updated_at":"2023-03-20T07:06:10.000-07:00","published_at":"2023-03-16T14:47:26.000-07:00","custom_excerpt":"We're hosting a meetup for Open Source Software startups! YC has funded over 75 OSS companies to date and we’re especially excited about them. If you’re interested in starting one someday, join us to connect \u0026 learn with other founders in the space.","codeinjection_head":null,"codeinjection_foot":null,"custom_template":null,"canonical_url":null,"authors":[{"id":"61fe29e3c7139e0001a7106f","name":"Y Combinator","slug":"yc","profile_image":"/blog/content/images/2022/02/yc.png","cover_image":null,"bio":null,"website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/yc/"}],"tags":[{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/yc-news/"},{"id":"61fe29efc7139e0001a71179","name":"YC Events","slug":"yc-events","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"