12238da32f070001d502c1","name":"#26413","slug":"hash-26413","description":null,"feature_image":null,"visibility":"internal","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/404/"}],"primary_author":{"id":"61fe29e3c7139e0001a7106f","name":"Y Combinator","slug":"yc","profile_image":"https://ghost.prod.ycinside.com/content/images/2022/02/yc.png","cover_image":null,"bio":null,"website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/yc/"},"primary_tag":{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/yc-news/"},"url":"https://ghost.prod.ycinside.com/yc-meetup-on-building-open-source-software-startups/","excerpt":"We're hosting a meetup for Open Source Software startups! YC has funded over 75 OSS companies to date and we’re especially excited about them. If you’re interested in starting one someday, join us to connect \u0026 learn with other founders in the space.","reading_time":1,"access":true,"og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"email_subject":null,"frontmatter":null,"feature_image_alt":null,"feature_image_caption":null},{"id":"640f88ee8cd9c60001e58302","uuid":"72313612-7376-404d-9a29-d9292d8b6785","title":"Changes at YC","slug":"changes-at-yc","html":"\u003cp\u003eYC is known primarily as a place where very early founders create something from nothing by simply applying online and joining the world’s best founder community. When they do, a shocking percentage of them will go on to make a startup worth a billion dollars (on average 6 out of 100 startups in recent batches).\u003cbr\u003e\u003cbr\u003eYC is rightly known for early stage investing. In recent years, we have also done some late stage investing. But late stage investing turned out to be so different from early stage that we found it to be a distraction from our core mission. So we’re going to decrease the amount of late stage investing we do.\u003cbr\u003e\u003cbr\u003eUnfortunately, this means we will no longer need some of the roles on the late stage investing team. Seventeen of our teammates are impacted today. As we make this change in strategy, we want to acknowledge and express our appreciation for their substantial contributions.\u003cbr\u003e\u003cbr\u003eThere shouldn’t be any noticeable effect on the companies we’ve funded or on the way we interact with alumni, but if any companies or alumni have questions, I’m here and the YC group partners are here — as always, to help you make something people want.\u003c/p\u003e","comment_id":"640f88ee8cd9c60001e58302","feature_image":"/blog/content/images/2023/03/changes.png","featured":false,"visibility":"public","email_recipient_filter":"none","created_at":"2023-03-13T13:34:54.000-07:00","updated_at":"2023-03-16T09:45:18.000-07:00","published_at":"2023-03-13T13:42:06.000-07:00","custom_excerpt":"In recent years, we have also done some late stage investing. But late stage investing turned out to be so different from early stage that we found it to be a distraction from our core mission. So we’re going to decrease the amount of late stage investing we do.","codeinjection_head":null,"codeinjection_foot":null,"custom_template":null,"canonical_url":null,"authors":[{"id":"61fe29e3c7139e0001a710d2","name":"Garry Tan","slug":"garry","profile_image":"/blog/content/images/2023/03/Instagram-Image-Template--Square---21-.png","cover_image":null,"bio":"Garry is the President \u0026 CEO of Y Combinator. Previously, he was the co-founder \u0026 Managing Partner of Initialized Capital. Before that, he co-founded Posterous (YC S08) which was acquired by Twitter.","website":null,"location":null,"facebook":null,"twitter":"@garrytan","meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/garry/"}],"tags":[{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/yc-news/"}],"primary_author":{"id":"61fe29e3c7139e0001a710d2","name":"Garry Tan","slug":"garry","profile_image":"https://ghost.prod.ycinside.com/content/images/2023/03/Instagram-Image-Template--Square---21-.png","cover_image":null,"bio":"Garry is the President \u0026 CEO of Y Combinator. Previously, he was the co-founder \u0026 Managing Partner of Initialized Capital. Before that, he co-founded Posterous (YC S08) which was acquired by Twitter.","website":null,"location":null,"facebook":null,"twitter":"@garrytan","meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/garry/"},"primary_tag":{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/yc-news/"},"url":"https://ghost.prod.ycinside.com/changes-at-yc/","excerpt":"In recent years, we have also done some late stage investing. But late stage investing turned out to be so different from early stage that we found it to be a distraction from our core mission. So we’re going to decrease the amount of late stage investing we do.","reading_time":1,"access":true,"og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"email_subject":null,"frontmatter":null,"feature_image_alt":null,"feature_image_caption":null},{"id":"640cfb5e75964d0001badbbd","uuid":"241b7238-38da-4030-a27c-84f038d1924c","title":"Urgent: Sign the petition now","slug":"urgent-sign-the-petition-now-thousands-of-startups-and-hundreds-of-thousands-of-startup-jobs-are-at-risk","html":"\u003cp\u003e\u003cem\u003eOver 5,000 CEOs and founders representing over 400,000 employees have signed this petition: \u003c/em\u003e\u003ca href=\"https://docs.google.com/forms/d/e/1FAIpQLSd0_0JOGdaXSDs-WaAXzzEy_tR7akOF7GBTfTb-r-Me0trNPQ/viewform?usp=sf_link\" rel=\"noopener noreferrer\"\u003e\u003cem\u003ehttps://docs.google.com/forms/d/e/1FAIpQLSd0_0JOGdaXSDs-WaAXzzEy_tR7akOF7GBTfTb-r-Me0trNPQ/viewform?usp=sf_link\u003c/em\u003e\u003c/a\u003e\u003c/p\u003e\u003cp\u003e\u003c/p\u003e\u003cp\u003eTo the Honorable Secretary Janet Yellen, Chairman Martin J. Gruenberg, Chairman Brown, and Chairman McHenry:\u003c/p\u003e\u003cp\u003eWe, the undersigned, are deeply concerned about the rapid failure of Silicon Valley Bank, a leading financial institution that has played a vital role in supporting the technology industry in the United States. We are not asking for a bailout for the bank equity holders or its management; we are asking you to save innovation in the American economy. \u003c/p\u003e\u003cp\u003eWe ask for relief and attention to an immediate critical impact on small businesses, startups, and their employees who are depositors at the bank. According to the NVCA, Silicon Valley Bank has over 37,000 small businesses with more than $250,000 in deposits. These balances are now unavailable to them, and without further intervention, according to the FDIC website, may be inaccessible for months to years. \u003c/p\u003e\u003cp\u003eIn the Y Combinator community, one-third of startups with exposure to SVB used SVB as their sole bank account. As a result, they will fail to have the cash to run payroll in the next 30 days. By that measure, we can estimate that payroll-related furlough or shutdown will impact more than 10,000 small businesses and startups. If the average small business or startup employs 10 workers, this will have an immediate effect of furlough, layoff, or shutdown, affecting over 100,000 jobs in the most vibrant sector of innovation in our economy. \u003c/p\u003e\u003cp\u003eSilicon Valley Bank’s failure has a real risk of systemic contagion. Its collapse has already instilled fear among founders and management teams to look for safer havens for their remaining cash, which can trigger a bank run on every other smaller bank.  \u003c/p\u003e\u003cp\u003eIf we allow this to happen, it will immediately impact the US technology industry and US competitiveness worldwide and ultimately set back US competitiveness by a decade or more, while the rest of the world races forward.\u003c/p\u003e\u003cp\u003eWe have a simple ask: \u003cbr\u003e- \u003cstrong\u003eSmall business depositors at Silicon Valley Bank should be made whole. Regulators need to conduct a backstop of depositors. We are not asking for a bank bailout\u003c/strong\u003e. \u003cbr\u003e- Longer term, Congress should work to restore stronger regulatory oversight and capital requirements for regional banks, and any malfeasance or mismanagement on the part of SVB executives leading to this failure should be investigated.\u003c/p\u003e\u003cp\u003eThis requires swift and decisive action in order to prevent further shockwaves through the economy that could lead to financial crisis and layoffs of more than 100,000 workers. We must protect US competitiveness in the world. \u003c/p\u003e\u003cp\u003eThank you for your attention to this important matter.\u003c/p\u003e\u003cp\u003eSincerely,\u003cbr\u003eGarry Tan, CEO \u0026amp; President Y Combinator\u003c/p\u003e\u003cp\u003e\u003cbr\u003e\u003cem\u003eOver 5,000 CEOs and founders representing over 400,000 employees have signed this petition. If you're a current founder or CEO, please consider signing: \u003c/em\u003e\u003ca href=\"https://docs.google.com/forms/d/e/1FAIpQLSd0_0JOGdaXSDs-WaAXzzEy_tR7akOF7GBTfTb-r-Me0trNPQ/viewform?usp=sf_link\" rel=\"noopener noreferrer\"\u003e\u003cem\u003ehttps://docs.google.com/forms/d/e/1FAIpQLSd0_0JOGdaXSDs-WaAXzzEy_tR7akOF7GBTfTb-r-Me0trNPQ/viewform?usp=sf_link\u003c/em\u003e\u003c/a\u003e\u003c/p\u003e\u003c!--kg-card-begin: html--\u003e\u003ctable xmlns=\"http://www.w3.org/1999/xhtml\" cellspacing=\"0\" cellpadding=\"0\" dir=\"ltr\" border=\"1\" style=\"table-layout:fixed;font-size:10pt;font-family:Arial;width:0px;border-collapse:collapse;border:none\"\u003e\u003ccolgroup\u003e\u003ccol width=\"193\"\u003e\u003ccol width=\"158\"\u003e\u003ccol width=\"238\"\u003e\u003c/colgroup\u003e\u003ctbody\u003e\u003ctr style=\"height:21px;\"\u003e\u003ctd style=\"overflow:hidden;padding:2px 3px 2px 3px;vertical-align:bottom;\" data-sheets-value=\"{\u0026quot;1\u0026quot;:2,\u0026quot;2\u0026quot;:\u0026quot;Arash Ferdowsi\u0026quot;}\"\u003eArash Ferdowsi\u003c/td\u003e\u003ctd style=\"overflow:hidden;padding:2px 3px 2px 3px;vertical-align:bottom;\" data-sheets-value=\"{\u0026quot;1\u0026quot;:2,\u0026quot;2\u0026quot;:\u0026quot;Co-founder\u0026quot;}\"\u003eCo-founder\u003c/td\u003e\u003ctd style=\"overflow:hidden;padding:2px 3px 2px 3px;vertical-align:bottom;\" data-sheets-value=\"{\u0026quot;1\u0026quot;:2,\u0026quot;2\u0026quot;:\u0026quot;Dropbox\u0026