side.com/content/images/2022/02/yc.png","cover_image":null,"bio":null,"website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/yc/"},"primary_tag":null,"url":"https://ghost.prod.ycinside.com/urgent-sign-the-petition-now-thousands-of-startups-and-hundreds-of-thousands-of-startup-jobs-are-at-risk/","excerpt":"Nearly 40,000 of all depositors at Silicon Valley Bank were small businesses. If swift action isn’t taken, over 100,000 people could soon lose their jobs.","reading_time":25,"access":true,"og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"email_subject":null,"frontmatter":null,"feature_image_alt":null,"feature_image_caption":null},{"id":"64065a64fdd2660001ad1b84","uuid":"3c369705-68d1-4cf2-ac7e-2cd27b4712b8","title":"Surbhi Sarna's new book on entrepreneurship","slug":"surbhi-sarnas-new-book-on-entrepreneurship","html":"\u003cp\u003eYC Group Partner Surbhi Sarna has written a book called \u003ca href=\"https://www.amazon.com/Without-Doubt-How-Underrated-Unbeatable/dp/1982147903\"\u003e\u003cem\u003eWithout a Doubt\u003c/em\u003e\u003c/a\u003e\u003cem\u003e, \u003c/em\u003eand today it goes on sale.\u003c/p\u003e\u003cp\u003e\u003cem\u003eWithout a Doubt\u003c/em\u003e tells the incredible story of Surbhi Sarna's company, nVision Medical, which started with a health scare when she was 13 and ended 20 years later in a $275M acquisition. It's a must-read for anyone interested in healthcare. But it's also a must-read for any founder who feels underestimated, or anyone who isn't sure if starting a startup is for them.\u003c/p\u003e\u003cp\u003eI've been fortunate to hear Surbhi tell her story to a live audience, and it never fails to bring the house down. Now that it can reach so many more people, I expect it will inspire a whole generation of founders.\u003c/p\u003e\u003cp\u003e\u003cem\u003eWithout a Doubt\u003c/em\u003e captures the feeling of being a founder, with the raw emotion that comes from your life's work hanging in the balance. It is the unvarnished truth of what startups are really like. \u003c/p\u003e\u003cp\u003eInterspersed through the book is tactical advice on essential founder skills: networking, fundraising, getting feedback from users, hiring, creating a strong company culture, and managing board politics, along with many healthcare-specific topics like running clinical trials and determining regulatory strategy.\u003c/p\u003e\u003cp\u003eI have no idea how Surbhi managed to write a book while also being a Group Partner at YC (a more-than-full-time job!). She is a force of nature, and it's a great honor to get to work with her at YC.\u003c/p\u003e\u003cp\u003eYou can pick up your copy of \u003cem\u003eWithout a Doubt\u003c/em\u003e here:\u003c/p\u003e\u003cul\u003e\u003cli\u003e\u003ca href=\"https://www.amazon.com/Without-Doubt-How-Underrated-Unbeatable/dp/1982147903\"\u003eAmazon\u003c/a\u003e\u003c/li\u003e\u003cli\u003e\u003ca href=\"https://www.scribd.com/book/625114160/Without-a-Doubt-How-to-Go-from-Underrated-to-Unbeatable\"\u003eScribd\u003c/a\u003e\u003c/li\u003e\u003cli\u003e\u003ca href=\"https://www.indiebound.org/book/9781982147907\"\u003eLocal bookstores\u003c/a\u003e\u003c/li\u003e\u003c/ul\u003e","comment_id":"64065a64fdd2660001ad1b84","feature_image":"/blog/content/images/2023/03/1677718131042---Edited.png","featured":false,"visibility":"public","email_recipient_filter":"none","created_at":"2023-03-06T13:25:56.000-08:00","updated_at":"2023-03-07T09:04:07.000-08:00","published_at":"2023-03-07T09:00:00.000-08:00","custom_excerpt":null,"codeinjection_head":null,"codeinjection_foot":null,"custom_template":null,"canonical_url":null,"authors":[{"id":"61fe29e3c7139e0001a71097","name":"Jared Friedman","slug":"jared-friedman","profile_image":"/blog/content/images/2022/02/Jared.jpg","cover_image":null,"bio":"Jared is Managing Director, Software and Group Partner at YC. He was cofounder of Scribd, which was funded by Y Combinator in 2006 and grew to be one of the top 100 sites on the web.","website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/jared-friedman/"}],"tags":[{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/yc-news/"},{"id":"61fe29efc7139e0001a7117c","name":"Women Founders","slug":"women-founders","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/women-founders/"},{"id":"61fe29efc7139e0001a71152","name":"Founder Stories","slug":"founder-stories","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/founder-stories/"}],"primary_author":{"id":"61fe29e3c7139e0001a71097","name":"Jared Friedman","slug":"jared-friedman","profile_image":"https://ghost.prod.ycinside.com/content/images/2022/02/Jared.jpg","cover_image":null,"bio":"Jared is Managing Director, Software and Group Partner at YC. He was cofounder of Scribd, which was funded by Y Combinator in 2006 and grew to be one of the top 100 sites on the web.","website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/jared-friedman/"},"primary_tag":{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/yc-news/"},"url":"https://ghost.prod.ycinside.com/surbhi-sarnas-new-book-on-entrepreneurship/","excerpt":"YC Group Partner Surbhi Sarna has written a book called Without a Doubt, and today it goes on sale.Without a Doubt tells the incredible story of Surbhi Sarna's company, nVisionMedical, which started with a health scare when she was 13 and ended 20 yearslater in a $275M acquisition. It's a must-read for anyone interested inhealthcare.","reading_time":1,"access":true,"og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"email_subject":null,"frontmatter":null,"feature_image_alt":null,"feature_image_caption":null},{"id":"63fced280ca0ec00016319fa","uuid":"f1d9175c-3d17-4d36-92bf-a65b2362acc3","title":"Announcing Y Combinator's Spring 2022 Tech Hiring Event","slug":"yc-spring-2022-tech-hiring-event","html":"\u003cp\u003eWe're excited to host an \u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf\"\u003ein-person tech hiring event on Wednesday, March 8th\u003c/a\u003e at 5:30 PM at Y Combinator's San Francisco office. This will be the first in-person hiring event we're hosting at YC in over two years, and we have 9 YC-backed startups who are looking to hire engineers and technical talent.\u003c/p\u003e\u003cp\u003eThe event will feature brief founder \u0026amp; company overviews, time to network, and light food and drinks provided by YC. Spots are limited, so \u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf\"\u003eapply now\u003c/a\u003e to get on the list.\u003c/p\u003e\u003cp\u003eThe companies attending \u003cem\u003e(and what they're hiring for)\u003c/em\u003e below:\u003c/p\u003e\u003cul\u003e\u003cli\u003e\u003cstrong\u003e\u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf/onesignal\"\u003eOneSignal\u003c/a\u003e (Growth):\u003c/strong\u003e Engage customers through personalized omni-channel messaging \u003cem\u003e(Infrastructure and Product Engineers, Product Managers)\u003c/em\u003e\u003c/li\u003e\u003cli\u003e\u003cstrong\u003e\u003ca href=\"https://www.ycombinator.com/companies/memora-health\"\u003eMemora Health\u003c/a\u003e \u003cstrong\u003e(Series A):\u003c/strong\u003e\u003c/strong\u003e Helps healthcare organizations digitize and automate complex care workflows\u003c/li\u003e\u003cli\u003e\u003cstrong\u003e\u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf/seam\"\u003eSeam\u003c/a\u003e (Series A):\u003c/strong\u003e API for IoT Devices \u003cem\u003e(Engineering \u0026amp; Sales)\u003c/em\u003e\u003c/li\u003e\u003cli\u003e\u003cstrong\u003e\u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf/slope\"\u003eSlope\u003c/a\u003e (Series A):\u003c/strong\u003e Buy Now, Pay Later for B2B \u003cem\u003e(Backend \u0026amp; Full stack engineers; data; customer success)\u003c/em\u003e\u003c/li\u003e\u003cli\u003e\u003cstrong\u003e\u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf/fieldguide\"\u003eFieldguide\u003c/a\u003e (Series A):\u003c/strong\u003e Automation and collaboration software for audit and advisory firms\u003cem\u003e (ML Engineer, Product Manager)\u003c/em\u003e\u003c/li\u003e\u003cli\u003e\u003cstrong\u003e\u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf/agave\"\u003eAgave\u003c/a\u003e (Seed):\u003c/strong\u003e Plaid for Construction \u003cem\u003e(Founding Engineer in PHP/Typescript/React)\u003c/em\u003e\u003c/li\u003e\u003cli\u003e\u003cstrong\u003e\u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf/mintlify\"\u003eMintlify\u003c/a\u003e (Seed):\u003c/strong\u003e Developer-first documentation that converts users \u003cem\u003e(Full Stack Engineer)\u003c/em\u003e\u003c/li\u003e\u003cli\u003e\u003cstrong\u003e\u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf/replo\"\u003eReplo\u003c/a\u003e (Seed):\u003c/strong\u003e Visual development for React, starting with e-commerce \u003cem\u003e(Engineers \u0026amp; Designers)\u003c/em\u003e\u003c/li\u003e\u003cli\u003e\u003cstrong\u003e\u003ca href=\"https://www.ycombinator.com/events/meet-founders-sf/oneshop\"\u003eOneShop\u003c/a\u003e (Seed):\u003c/strong\u003e Operating system for reselling online \u003cem\u003e(Backend, Frontend and Growth Engineers)\u003c/em\u003e\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eIf you're an engineer interested in working at a fast-growing startup, this is an opportunity to meet founders and hiring managers in person to learn about their companies and products, understand their technology stacks and challenges, and get a sense of their culture and what it's like to work there.\u003c/p\u003e\u003cp\u003eThis is a unique chance to engage with multiple companies at once, and to potentially find your next role at a leading tech startup. We hope you'll join us for what will be an informative and worthwhile evening.\u003c/p\u003e\u003c!--kg-card-begin: html--\u003e\u003ccenter\u003e\n\u003ca class=\"ycdc-retro-btn ycdc-retro-btn-gold mt-[-10px] ml-[13px]\" href=\"https://www.ycombinator.com/events/meet-founders-sf\" style=\"text-decoration: none;\" title=\"Apply to YC Event\" target=\"_blank\"\u003eApply to Join\u003c/a\u003e\n\u003c/center\u003e\u003c!--kg-card-end: html--\u003e","comment_id":"63fced280ca0ec00016319fa","feature_image":"/blog/content/images/2023/02/BlogTwitter-Image-Template--5--1.png","featured":false,"visibility":"public","email_recipient_filter":"none","created_at":"2023-02-27T09:49:28.000-08:00","updated_at":"2023-03-06T12:57:26.000-08:00","published_at":"2023-02-28T09:00:00.000-08:00","custom_excerpt":null,"codeinjection_head":null,"codeinjection_foot":null,"custom_template":null,"canonical_url":null,"authors":[{"id":"61fe29e3c7139e0001a710bf","name":"Ryan Choi","slug":"rchoi","profile_image":"//www.gravatar.com/avatar/36ba914c5f191f813e96db0296154469?s=250\u0026d=mm\u0026r=x","cover_image":null,"bio":"Ryan works with YC companies to find great engineers — from 2-person startups to larger ones like Airbnb, Stripe and Instacart.","website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/rchoi/"}],"tags":[{"id":"61fe29efc7139e0001a71178","name":"#jobs","slug":"hash-jobs","description":null,"feature_image":null,"visibility":"internal","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/404/"},{"id":"61fe29efc7139e0001a71171","name":"Work at a Startup","slug":"work-at-a-startup","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/work-at-a-startup/"},{"id":"62ba0d42063d2d0001f0fc7a","name":"#76","slug":"hash-76","descripti