title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/404/"}],"primary_author":{"id":"61fe29e3c7139e0001a710bf","name":"Ryan Choi","slug":"rchoi","profile_image":"//www.gravatar.com/avatar/36ba914c5f191f813e96db0296154469?s=250\u0026d=mm\u0026r=x","cover_image":null,"bio":"Ryan works with YC companies to find great engineers — from 2-person startups to larger ones like Airbnb, Stripe and Instacart.","website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/rchoi/"},"primary_tag":null,"url":"https://ghost.prod.ycinside.com/yc-spring-2022-tech-hiring-event/","excerpt":"We're excited to host an in-person tech hiring event on Wednesday, March 8th at 5:30 PM at YCombinator's San Francisco office. This will be the first in-person hiring eventwe're hosting at YC in over two years, and we have 9 YC-backed startups who arelooking to hire engineers and technical talent.The event will feature brief founder \u0026 company overviews, time to network, andlight food and drinks provided by YC.","reading_time":1,"access":true,"og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"email_subject":null,"frontmatter":null,"feature_image_alt":null,"feature_image_caption":null},{"id":"63f91878d2b0220001e8d6e9","uuid":"a99f2458-1bdd-4a40-81e6-36ee441b133c","title":"Congratulations to the 2023 YC Top Companies!","slug":"yc-top-companies-feb-2023","html":"\u003cp\u003eWe’re excited to present the 2023 YC Top Companies!\u003c/p\u003e\u003cp\u003eThe startups are separated into 3 lists: YC’s top \u003ca href=\"https://www.ycombinator.com/topcompanies\" rel=\"noopener noreferrer\"\u003eprivate\u003c/a\u003e, \u003ca href=\"https://www.ycombinator.com/topcompanies/public\" rel=\"noopener noreferrer\"\u003epublic\u003c/a\u003e, and \u003ca href=\"https://www.ycombinator.com/topcompanies/exits\" rel=\"noopener noreferrer\"\u003eexited\u003c/a\u003e. Private companies and exits are sorted by the company's valuation from their latest funding round, and all are valued at over $150M. Public companies are listed in alphabetical order.\u003c/p\u003e\u003cp\u003eThe Breakthrough Companies list highlights the fast-growing companies we’ve doubled down on – which means they’ve all received significant additional investment from YC in their post-Demo Day rounds. \u003c/p\u003e\u003cp\u003e\u003cstrong\u003eHere are stats about the companies on this year’s list:\u003c/strong\u003e\u003c/p\u003e\u003cp\u003e\u003cstrong\u003e\u0026gt;\u003c/strong\u003e More than 290 private YC companies and 33 exits are valued at over $150M, over 90 are worth more than $1B, and 16 are public. \u003c/p\u003e\u003cp\u003e\u003cstrong\u003e\u0026gt;\u003c/strong\u003e 58% of the companies have HQs in the Bay Area. 27% of the companies are fully remote, and 55% list themselves as partially remote.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003e\u0026gt;\u003c/strong\u003e YC Top Companies have HQs in 40 countries including: United States, India, United Kingdom, Canada, Colombia, Indonesia, Mexico, Nigeria, Argentina, Brazil, Chile, France, Spain, Israel, Netherlands, Philippines, Portugal, Germany, Egypt, Ireland, South Korea, Peru, Singapore, United Arab Emirates, Australia, Bolivia, Switzerland, Algeria, Estonia, Finland, Hungary, Italy, Norway, Romania, Sweden, Senegal, Uganda, Uruguay, Venezuela, Vietnam\u003c/p\u003e\u003cp\u003e\u003cstrong\u003e\u0026gt;\u003c/strong\u003e YC W16 is the most represented batch (by percentage). 23% of the companies from W16 are on the YC Top Companies list. \u003c/p\u003e\u003cp\u003e\u003cstrong\u003e\u0026gt;\u003c/strong\u003e Here’s a sector breakdown of the top companies:\u003c/p\u003e\u003cul\u003e\u003cli\u003eB2B Software and Services: 43%\u003c/li\u003e\u003cli\u003eFinancial Technology and Services: 19%\u003c/li\u003e\u003cli\u003eConsumer: 13%\u003c/li\u003e\u003cli\u003eHealthcare: 12%\u003c/li\u003e\u003cli\u003eIndustrials: 7%\u003c/li\u003e\u003cli\u003eReal Estate and Construction: 3%\u003c/li\u003e\u003cli\u003eEducation and Government: 3%\u003c/li\u003e\u003c/ul\u003e\u003cp\u003e\u003cstrong\u003e\u0026gt;\u003c/strong\u003e 10 new companies joined the lists since August 2022:\u003c/p\u003e\u003cp\u003ePrivate:\u003c/p\u003e\u003cul\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/treasury-prime\"\u003eTreasury Prime\u003c/a\u003e (YC W18) - Embedded banking software platform and marketplace\u003c/li\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/onesignal\"\u003eOneSignal\u003c/a\u003e (YC S11) - Engage customers through personalized omni-channel messaging\u003c/li\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/skill-lync\"\u003eSkill-lync\u003c/a\u003e (YC W19) - Online engineering college for India\u003c/li\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/tigereye\"\u003eTigerEye\u003c/a\u003e (YC S22) - Modern enterprise software for sales leaders\u003c/li\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/zeitview\"\u003eZeitview\u003c/a\u003e (YC W15) - Inspection software for renewable energy \u0026amp; sustainable infrastructure\u003c/li\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/ontop\"\u003eOnTop\u003c/a\u003e (YC W21) - A bank for remote workers connected to payroll\u003c/li\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/obie\"\u003eObie\u003c/a\u003e (YC S19) - Insurance and risk management for landlords\u003c/li\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/nabis\"\u003eNabis\u003c/a\u003e (YC W19) - The largest licensed cannabis wholesale platform\u003c/li\u003e\u003c/ul\u003e\u003cp\u003ePublic:\u003c/p\u003e\u003cul\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/presto\"\u003ePresto\u003c/a\u003e (YC S10) - Digital meets physical for big chain restaurants\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eExits:\u003c/p\u003e\u003cul\u003e\u003cli\u003e\u003ca href=\"https://www.ycombinator.com/companies/nurx\"\u003eNURX\u003c/a\u003e (YC W16) - Medicine or testing kit, prescribed online, and delivered to your door \u003c/li\u003e\u003c/ul\u003e\u003cp\u003eOne thing to note is that this is not an exhaustive list of YC’s top companies. We allowed founders to opt out of being listed for any reason. The full list of YC companies can be found \u003ca href=\"https://www.ycombinator.com/companies\"\u003ehere\u003c/a\u003e. \u003c/p\u003e\u003cp\u003eCongrats again to the companies recognized on the 2023 YC Top Companies list!\u003c/p\u003e","comment_id":"63f91878d2b0220001e8d6e9","feature_image":"/blog/content/images/2023/02/BlogTwitter-Image-Template.png","featured":true,"visibility":"public","email_recipient_filter":"none","created_at":"2023-02-24T12:05:12.000-08:00","updated_at":"2023-03-16T09:44:58.000-07:00","published_at":"2023-02-27T09:00:00.000-08:00","custom_excerpt":"There are now 16 public YC companies, 290 private YC companies and 33 exits that are valued at over $150M, and over 80 that are worth more than $1B.","codeinjection_head":null,"codeinjection_foot":null,"custom_template":null,"canonical_url":null,"authors":[{"id":"61fe29e3c7139e0001a7106f","name":"Y Combinator","slug":"yc","profile_image":"/blog/content/images/2022/02/yc.png","cover_image":null,"bio":null,"website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/yc/"}],"tags":[{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":nu