"og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/404/"},{"id":"63f91d15d2b0220001e8d711","name":"#12600","slug":"hash-12600","description":null,"feature_image":null,"visibility":"internal","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/404/"},{"id":"63f91d15d2b0220001e8d712","name":"#11995","slug":"hash-11995","description":null,"feature_image":null,"visibility":"internal","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/404/"}],"primary_author":{"id":"61fe29e3c7139e0001a7106f","name":"Y Combinator","slug":"yc","profile_image":"https://ghost.prod.ycinside.com/content/images/2022/02/yc.png","cover_image":null,"bio":null,"website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/yc/"},"primary_tag":{"id":"61fe29efc7139e0001a71173","name":"YC News","slug":"yc-news","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/yc-news/"},"url":"https://ghost.prod.ycinside.com/yc-top-companies-feb-2023/","excerpt":"There are now 16 public YC companies, 290 private YC companies and 33 exits that are valued at over $150M, and over 80 that are worth more than $1B.","reading_time":2,"access":true,"og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"email_subject":null,"frontmatter":null,"feature_image_alt":null,"feature_image_caption":null},{"id":"63f6c745d2b0220001e8d6cc","uuid":"ca31519b-08e6-4688-b942-b2cbcf0ba746","title":"Why would you work at a startup in an economic downturn?","slug":"why-would-you-work-at-a-startup-in-an-economic-downturn","html":"\u003cp\u003eNow is as good a time as any to start a startup – especially if you get into YC. But what about \u003cem\u003ejoining\u003c/em\u003e a startup in this economy? We’re obviously biased, but we think it’s a great time to join a startup too. Here are three reasons to consider: \u003c/p\u003e\u003cp\u003e\u003cstrong\u003eImpactful job opportunities are available at YC startups. \u003c/strong\u003eDespite other companies pulling back on hiring in 2022, YC startups added 2.1K jobs on \u003ca href=\"https://www.ycombinator.com/jobs?utm_source=ycblog\"\u003eour hiring platform\u003c/a\u003e, with 410 added in January 2023 alone. The biggest categories were in engineering (35%), sales (17%), operations (15%), and marketing (13%). And more than 1,100 YC startups were active on YC’s hiring platform in January. Many of the roles are for early engineers/employees, so you’ll have a chance to shape the product, best practices and company culture early on. \u003c/p\u003e\u003cp\u003e\u003cstrong\u003eOn average, YC startups are in a better position to be hiring. \u003c/strong\u003eYC startups raise an average $2-4M after going through the YC program. But despite this, we still tell them to \u003ca href=\"https://techcrunch.com/2022/05/19/yc-advises-founders-to-plan-for-the-worst/\"\u003e“plan for the worst”\u003c/a\u003e – and that includes saving money and only hiring if they absolutely need to. So as a job seeker, you’ll find that YC founders are generally smarter about their cash, watch their burn closely, and have put more thought into who to hire – for their benefit and yours. (And if you don’t know these terms or want to learn how to ask, read \u003ca href=\"https://www.ycombinator.com/blog/how-to-pick-the-right-startup-to-work-for\"\u003eour advice here\u003c/a\u003e.)\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eBig tech might not offer the stability or purpose that it used to. \u003c/strong\u003e3.1x new job seekers joined our hiring platform (comparing June 2022 to January 2023), with a strong increase in people coming from FAANG. People tell us that they don’t equate big tech with stability anymore, and they’re looking for more personal meaning and clarity of mission in their next role. YC has been investing in a wide range of startups – from \u003ca href=\"https://www.ycombinator.com/companies/nira-energy/jobs?utm_source=ycblog\"\u003eclimate\u003c/a\u003e to \u003ca href=\"https://www.ycombinator.com/companies/whatnot/jobs?utm_source=ycblog\"\u003ecollectibles\u003c/a\u003e to \u003ca href=\"https://www.ycombinator.com/companies/astroforge/jobs?utm_source=ycblog\"\u003easteroid mining\u003c/a\u003e – so you can find one that aligns with your passions and interests. (And if you don’t find one, just \u003ca href=\"mailto:workatastartup@ycombinator.com\"\u003eemail us\u003c/a\u003e for recommendations.)\u003c/p\u003e\u003cp\u003eMaybe you’ve been playing it safe in your career, and it’s time to try something more exciting and mission driven. Or maybe you’ve had a setback given the current economic climate and want to see what’s out there. Either way, we hope you consider a startup – and particularly a YC one. There are thousands of open roles at startups (seed, growth, and even scale) on \u003ca href=\"http://ycombinator.com/jobs?utm_source=ycblog\"\u003eYC’s hiring platform\u003c/a\u003e. And our founders could use your help building new frontier tech, building their companies that will last, and making things that people want. \u003c/p\u003e\u003cp\u003eLet’s go build the future.\u003c/p\u003e","comment_id":"63f6c745d2b0220001e8d6cc","feature_image":"/blog/content/images/2023/02/BlogTwitter-Image-Template--5-.png","featured":true,"visibility":"public","email_recipient_filter":"none","created_at":"2023-02-22T17:54:13.000-08:00","updated_at":"2023-02-23T08:00:00.000-08:00","published_at":"2023-02-23T08:00:00.000-08:00","custom_excerpt":"Now is as good a time as any to start a startup – especially if you get into YC. But what about joining a startup in this economy? We’re obviously biased, but we think it’s a great time to join a startup too. Here are three reasons to consider.","codeinjection_head":null,"codeinjection_foot":null,"custom_template":null,"canonical_url":null,"authors":[{"id":"61fe29e3c7139e0001a710bf","name":"Ryan Choi","slug":"rchoi","profile_image":"//www.gravatar.com/avatar/36ba914c5f191f813e96db0296154469?s=250\u0026d=mm\u0026r=x","cover_image":null,"bio":"Ryan works with YC companies to find great engineers — from 2-person startups to larger ones like Airbnb, Stripe and Instacart.","website":null,"location":null,"facebook":null,"twitter":null,"meta_title":null,"meta_description":null,"url":"https://ghost.prod.ycinside.com/author/rchoi/"}],"tags":[{"id":"61fe29efc7139e0001a71177","name":"Jobs","slug":"jobs","description":null,"feature_image":null,"visibility":"public","og_image":null,"og_title":null,"og_description":null,"twitter_image":null,"twitter_title":null,"twitter_description":null,"meta_title":null,"meta_description":null,"codeinjection_head":null,"codeinjection_foot":null,"canonical_url":null,"accent_color":null,"url":"https://ghost.prod.ycinside.com/tag/jobs/"},{"id":"61fe29efc7139e0001a7116d","name":"Essay","slug":"essay","description":null,"fea